package controller

import (
	"encoding/json"
	"fmt"
	"github.com/astaxie/beego/httplib"
	"time"
	"wolfcli/global"
)

func CheckGetFeature() {
	post := httplib.Post(fmt.Sprintf("http://%s:3154/x-api/v1/ai/detect/all", global.IP))
	post.SetTimeout(time.Second*3, time.Second)
	payload := make(map[string]map[string]string)
	payload["image"] = make(map[string]string)
	payload["image"]["file"] = ""
	payloadJson, _ := json.MarshalIndent(&payload, "", " ")
	fmt.Println(string(payloadJson))
	body := post.Body(payloadJson)
	result := make(map[string]map[string]string)
	bytes, err := body.Bytes()
	if err != nil {
		fmt.Println(err)
	}
	_ = json.Unmarshal(bytes, &result)
	if len(result) != 0 {
		fmt.Println(result)
	}
}
